    N = int(stdin.splitlines()[0])
    board = [[int(x) for x in line.split()] for line in stdin.splitlines()[1:]]

    def get_neighbors(row, col, board):
        neighbors = []
        for dr, dc in [(-2, -1), (-2, 1), (-1, -2), (-1, 2), (1, -2), (1, 2), (2, -1), (2, 1)]:
            new_row, new_col = row + dr, col + dc
            if 0 <= new_row < N and 0 <= new_col < N:
                neighbors.append((new_row, new_col, board[new_row][new_col]))
        return neighbors

    def get_piece(row, col, board):
        if board[row][col] == 1:
            return "knight"
        elif board[row][col] == N * (N - 1) + 1:
            return "rook"
        else:
            return "bishop"

    def get_move_cost(piece, from_row, from_col, to_row, to_col):
        if piece == "knight":
            return 2
        elif piece == "bishop":
            return abs(to_row - from_row) + abs(to_col - from_col)
        else:
            return max(abs(to_row - from_row), abs(to_col - from_col))

    def get_move_cost_with_replacement(piece, from_row, from_col, to_row, to_col, board):
        if piece == "knight":
            return 2
        elif piece == "bishop":
            return abs(to_row - from_row) + abs(to_col - from_col)
        else:
            return max(abs(to_row - from_row), abs(to_col - from_col)) + 1

    def dfs(row, col, board, visited, piece, step, replacement_moves):
        if (row, col) in visited:
            return step, replacement_moves
        visited.add((row, col))
        if (row, col) == (N - 1, N - 1):
            return step, replacement_moves
        neighbors = get_neighbors(row, col, board)
        for neighbor in neighbors:
            new_row, new_col, new_piece = neighbor
            if get_piece(new_row, new_col, board) != piece:
                dfs(new_row, new_col, board, visited, piece, step + 1, replacement_moves + get_move_cost_with_replacement(piece, row, col, new_row, new_col, board))
            else:
                dfs(new_row, new_col, board, visited, piece, step + 1, replacement_moves + get_move_cost(piece, row, col, new_row, new_col))
        return step, replacement_moves

    visited = set()
    piece = get_piece(0, 0, board)
    step, replacement_moves = dfs(0, 0, board, visited, piece, 0, 0)
    return step, replacement_moves


