            visited.add(node)
            path.append(node)
            for neighbor, _ in graph[node]:
                if neighbor not in visited:
                    dfs(neighbor, visited, path, paths)
            paths.append(path[:])

        dfs(1, set(), [], paths)
        shortest_path = min(paths, key=lambda x: len(x))
        return [(x, y, 1 - z) for x, y, z in roads if (x, y, z) not in zip(shortest_path, shortest_path[1:], [1 - z for _, _, z in roads])]

