        x_b, y_b, z_b = points[b - 1]
        min_x, max_x = min(x_a, x_b), max(x_a, x_b)
        min_y, max_y = min(y_a, y_b), max(y_a, y_b)
        min_z, max_z = min(z_a, z_b), max(z_a, z_b)
        for i in range(n):
            if i == a - 1 or i == b - 1:
                continue
            x, y, z = points[i]
            if min_x <= x <= max_x and min_y <= y <= max_y and min_z <= z <= max_z:
                return False
        return True

    def find_balanced_pair(a, b):
        for i in range(n):
            if i == a - 1 or i == b - 1:
                continue
            if is_balanced(a, i + 1) and is_balanced(i + 1, b):
                return i + 1
        return None

