    for i in range(n // 2):
        a = find_balanced_pair(1, n - i)
        b = find_balanced_pair(a, n - i)
        pairs.append((a, b))
        points = [p for i, p in enumerate(points) if i + 1 not in (a, b)]
        n -= 2

    return '\n'.join(f"{a} {b}" for a, b in pairs)

