    a = list(map(int, stdin.splitlines()[1].split()))

    def parent(i: int) -> int:
        return (i - 1) // 2

    def left_child(i: int) -> int:
        return 2 * i + 1

    def right_child(i: int) -> int:
        return 2 * i + 2

    def heapify(a: list, i: int, k: int) -> None:
        l = left_child(i)
        r = right_child(i)
        smallest = i

        if l < k and a[l] < a[smallest]:
            smallest = l

        if r < k and a[r] < a[smallest]:
            smallest = r

        if smallest != i:
            a[i], a[smallest] = a[smallest], a[i]
            heapify(a, smallest, k)

    def count_violations(a: list, k: int) -> int:
        heapify(a, 0, k)
        violations = 0

        for i in range(1, k):
            if a[i] < a[parent(i)]:
                violations += 1

        return violations

    result = []
    for k in range(1, n):
        result.append(count_violations(a, k))

    return ' '.join(map(str, result))

