    paths = []

    for _ in range(k):
        path = []
        visited = set()
        queue = [(1, 1)]
        visited.add((1, 1))

        while queue:
            i, j = queue.pop(0)
            path.append((i, j))

            if (i, j) == (n, m):
                break

            for di, dj in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                ni, nj = i + di, j + dj
                if 1 <= ni <= n and 1 <= nj <= m and (ni, nj) not in visited and abs(ni - i) + abs(nj - j) == 1:
                    queue.append((ni, nj))
                    visited.add((ni, nj))

