    def parse_truth_table(truth_table: str) -> str:
        x = y = z = ""
        for i in range(4):
            x = "x" if truth_table[i] == "1" else "!" + x
            y = "y" if truth_table[i + 4] == "1" else "!" + y
            z = "z" if truth_table[i + 8] == "1" else "!" + z
        return x + "&" + y + "|" + z

    def to_postfix(expression: str) -> str:
        stack = []
        postfix = ""
        for token in expression:
            if token.isalpha():
                postfix += token
            elif token == "!":
                postfix += token
            elif token == "(":
                stack.append(token)
            elif token == ")":
                while stack and stack[-1] != "(":
                    postfix += stack.pop()
                stack.pop()
            else:
                while stack and stack[-1] != "(" and has_higher_priority(token, stack[-1]):
                    postfix += stack.pop()
                stack.append(token)
        while stack:
            postfix += stack.pop()
        return postfix

    def has_higher_priority(op1: str, op2: str) -> bool:
        if op1 == "!" or op2 == "!":
            return op1 == "!"
        elif op1 == "&" or op2 == "&":
            return op1 == "&"
        else:
            return op1 == "|"

    def evaluate(expression: str, x: str, y: str, z: str) -> str:
        stack = []
        for token in expression:
            if token.isalpha():
                if token == "x":
                    stack.append(x)
                elif token == "y":
                    stack.append(y)
                else:
                    stack.append(z)
            elif token == "!":
                stack.append("!" + stack.pop())
            elif token == "&":
                stack.append(stack.pop() + "&" + stack.pop())
            elif token == "|":
                stack.append(stack.pop() + "|" + stack.pop())
        return stack[0]

    def find_min_length_expression(functions: List[str]) -> List[str]:
        min_length_expressions = []
        for function in functions:
            truth_table = function
            expression = parse_truth_table(truth_table)
            postfix = to_postfix(expression)
            min_length_expressions.append(postfix)
        return min_length_expressions

    def find_lexicographically_smallest(expressions: List[str]) -> str:
        return min(expressions)

    min_length_expressions = find_min_length_expression(functions)
    lexicographically_smallest = find_lexicographically_smallest(min_length_expressions)
    return lexicographically_smallest

