    def encode_message(text, num_steps):
        for _ in range(num_steps):
            text = apply_cipher(text, offset)
        return text

    encoded_message = encode_message(message, num_steps)
    vowel_count, consonant_count = count_vowels_consonants(encoded_message)

    if vowel_count >= consonant_count:
        return 'Boris'
    else:
        return 'Colleague'

