            sub_perms = generate_permutations(n - 1)
            for perm in sub_perms:
                perm.append(i)
                result.append(perm)
        return result

    def is_subsequence(subseq: list, perm: list) -> bool:
        i = 0
        j = 0
        while i < len(subseq) and j < len(perm):
            if subseq[i] == perm[j]:
                i += 1
            j += 1
        return i == len(subseq)

    permutations = generate_permutations(n)
    for perm in permutations:
        if is_subsequence(remaining_gnomes, perm):
            return '\n'.join(map(str, perm))

